import React, { Component } from 'react'

class Table extends Component {
    tableStyle = {
        color: "black",
        padding: "10px",
        fontFamily: "Arial",
        border : 'solid'
    }
    render() {
        return (
            <div>
                <table style = {this.tablestyle}>
                <tr style = {{    border : 'solid'}}>
                        <td>Date</td>
                        <td>Description</td>
                        <td>Debit</td>
                        <td>Credit</td>
                        <td>Balance</td>
                    </tr>
                </table>
            </div>
        )
    }
}

export default Table
